import React from "react";

export default function Main() {
  return (
    <div id="content" className="mt-3">
      <div className="table text-muted text-center">
        <thead>
          <tr style={{ color: 'gray' }}>
            <th scope="col">Staking Balance</th>
            <th scope="col">Reward Balance</th>
          </tr>
        </thead>
        <tbody>
          <tr></tr>
          <tr></tr>
        </tbody>
      </div>
    </div>
  );
}
